.data

# El display parte en la direccion de memoria 0x100100000 que es el primer segmento de dato que se encuetra
# en el area .data
# Por eso "display" debe ir antes que todos los demas datos
# AJUSTAR DIMENSIONES EN 256 POR 256 PIXELES
# calculo del display se necesitan 256 pixeles de largo y ancho y se necesitan 4 bits para representarlos:
#	256x4x256 = 262144 
display: .word 0:262144

# El tablero esta representado por 3 elementos, su posicion X e Y, y la cantidad de bombas a su al rededor (pX,pY,cb)
# si la cantidad de bombas (cb) es 9 es una bomba
# 4bits de memoria x 3 elementos x 17 filas x 17 columnas = 3468
# donde un punto del tablero esta representado por cada 12 bits

tablero: .word 0:3468

